import React from 'react';
import Footer from '../../components/Footer';
import Header from '../../components/Header';
import { Link } from 'react-router-dom';
import Input from '../../components/Input';
import ImgUsuario from '../../assets/image/usuario.jpg';
import IconEdit from '../../assets/image/icone-editar.png';
import '../../assets/style/global.css';
import './style.css';

function DashboardAluno() {

    return (
        <div>
            <Header />
            <div className="Perfil">

                <div className="title">
                    <Link to='/'>Voltar</Link>
                    <h1>Informações pessoais</h1>
                </div>
                <div className="conteudo">
                    <div className="foto">
                        <img src={ImgUsuario} alt="Image de um usuário" />
                        <div className="icon">
                            <Input label="Nome: " name="Nome" />
                            <img id="IconEdit" src={IconEdit} alt="icone de edição de informaçãos"/>
                        </div>
                    </div>
                    <div className="informacoes">

                    </div>
                </div>
            </div>
            <Footer />
        </div>
    )
}

export default DashboardAluno;
